import { useEffect, useState } from "react";
import * as ContactosServices from "../../services/contactos.services";
import * as UserServices from "../../services/user.services";

function ListAgregarPlayer({evento_id, participantes}){
    

    const [playersToAdd, setPlayersToAdd] = useState([]);

    useEffect(() => {
        console.log('%cListAgregarPlayer.jsx line:2 evento_id', 'color: #007acc;', evento_id);
        console.log('%cListAgregarPlayer.jsx line:5 participantes', 'color: #007acc;', participantes);
        ContactosServices.findContacts()
        .then((contactos) => {
            console.log('%cListAgregarPlayer.jsx line:14 contactos', 'color: #007acc;', contactos);

            let contactosFiltrados = contactos.filter((contacto) => {
                let existe = false;
                participantes.forEach((participante) => {
                    if(contacto.friend_id === participante._id){
                        existe = true;
                    }
                });
                return !existe;
            });
            
            UserServices.getAllUsers(contactosFiltrados)
            .then((users) => {
                console.log('%cListAgregarPlayer.jsx line:25 users', 'color: #007acc;', users);
                setPlayersToAdd(users);
            });
        })
    }, [evento_id, participantes]);
    return (
        <>
                
            <p>ListAgregarPlayer</p>
        </>
    )
}

export default ListAgregarPlayer;
